### Summary of Core Topics, Concepts, Principles, and Equations

#### Python Programming
1. **Boolean Expressions and Logic**
   - Understanding Boolean expressions and logical operators (`and`, `or`, `not`).
   - De Morgan's Laws: `not (E1 and E2) = not E1 or not E2`.

2. **Input and Output**
   - Using `input()` to read user input.
   - Using `print()` to display output.

3. **Loops and Iterations**
   - `for` loops and `range()` function.
   - Nested loops and their applications.
   - Summation using loops.

4. **Lists and List Operations**
   - Creating and manipulating lists.
   - Appending elements to a list.
   - Accessing list elements using indices.

5. **Conditionals and Control Flow**
   - `if`, `elif`, and `else` statements.
   - Using flags to control flow.

6. **Matrix Operations**
   - Iterating through matrices.
   - Checking for symmetric matrices.

7. **Fibonacci Sequence**
   - Generating Fibonacci numbers.
   - Printing sequences of numbers.

8. **String Manipulation**
   - Splitting strings into words.
   - Reversing the order of words in a sentence.

#### Mathematical Concepts
1. **Summation Formulas**
   - Sum of the first `n` natural numbers: \( \sum_{k=1}^{n} k = \frac{n(n+1)}{2} \).
   - Sum of the first `n` terms of a series: \( \sum_{x=1}^{n} (n - x) = \frac{n^2 - n}{2} \).

2. **Factorials**
   - Calculating the factorial of a number: \( n! = n \times (n-1) \times \cdots \times 1 \).
   - Sum of factorials: \( \sum_{k=1}^{n} k! \).

3. **Matrix Symmetry**
   - Definition of a symmetric matrix: \( M[i][j] = M[j][i] \) for all \( i \) and \( j \).

### Equations
1. **Sum of a Series**
   \[
   \sum_{x=1}^{n} (n - x) = \frac{n^2 - n}{2}
   \]

2. **Sum of Factorials**
   \[
   \sum_{k=1}^{n} k!
   \]

3. **Fibonacci Sequence**
   \[
   F(n) = F(n-1) + F(n-2)
   \]
   where \( F(0) = 0 \) and \( F(1) = 1 \).

